// Homepage.js
import React from "react";
import BlogPost from "../components/BlogPost";
import Sidebar from "../components/Sidebar";

const HomepageContent = ({ blogPosts }) => (
  <div className="blog-posts-container">
    {blogPosts.map((post) => (
      <BlogPost key={post.id} post={post} />
    ))}
  </div>
);

const HomepageSidebar = ({ categories }) => (
  <div className="sidebar-container">
    <Sidebar categories={categories} />
  </div>
);

const Homepage = () => {
  // Assume you have a list of blog posts
  const blogPosts = [
    {
      id: 1,
      title: "Blog Post 1",
      imageUrl: "https://via.placeholder.com/200",
      content: "Short content for post 1",
    },
    // Add more blog posts as needed
  ];

  // Dummy categories for the sidebar selector
  const categories = ["Category 1", "Category 2", "Category 3"];

  return (
    <div className="homepage-container">
      <div className="row">
        <div className="col-md-9">
          <HomepageContent blogPosts={blogPosts} />
        </div>
        <div className="col-md-3">
          <HomepageSidebar categories={categories} />
        </div>
      </div>
    </div>
  );
};

export default Homepage;
